import React, { useState } from "react";
import Navbar from "../components/Navbar";
import "./ATRDay1.css";

function ATRDay1() {
  const [selectedRegion, setSelectedRegion] = useState(""); // Track selected region

  const regions = {
    "Nizam": ["OSV", "RRR"],
    "Guntur": ["Adhurs", "OSV", "Dhammu", "Baadshah", "JG", "RRR"],
    "Krishna": ["OSV", "JG", "RRR"],
    "Nellore": ["YD", "Baadshah", "RRR"],
    "UA": ["YD", "OSV", "Dhammu", "JG", "RRR"],
    "East": ["Adhurs", "OSV", "Baadshah", "JG"],
    "West": ["Adhurs", "OSV", "Dhammu"],
    "Ceeded": ["YD", "Adhurs", "OSV", "Dhammu", "Baadshah", "RRR"]
  };

  const handleSelection = (event) => {
    setSelectedRegion(event.target.value);
  };

  return (
    <div>
      <Navbar />
      <div className="movies-container">
        <div className="dropdown-container">
          <label htmlFor="region-select" className="dropdown-label">
            Select a region:
          </label>
          <select
            id="region-select"
            className="dropdown-select"
            value={selectedRegion}
            onChange={handleSelection}
          >
            <option value="" disabled>
              -- Choose an option --
            </option>
            {Object.keys(regions).map((region) => (
              <option key={region} value={region}>
                {region}
              </option>
            ))}
          </select>
        </div>

        {selectedRegion && (
          <div className="records-table">
            <h2>{selectedRegion}</h2>
            <p>Box Office data is compiled from various sources.</p>
            <table>
              <thead>
                <tr>
                  <th>#</th>
                  <th>Movie</th>
                </tr>
              </thead>
              <tbody>
                {regions[selectedRegion].map((movie, index) => (
                  <tr key={index}>
                    <td>{index + 1}</td>
                    <td>{movie}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

export default ATRDay1;
